                    <div class="ck__content_item">
                        <p><span style="color: #67ac2f;"> &#8226; </span> Theo Quỹ Nhi đồng Liên Hiệp Quốc, năm 2018, tại Việt Nam có 8-29% trẻ và vị thành niên gặp các vấn đề về sức khỏe tâm thần. Tại hội thảo trực tuyến chủ đề “Quản lý và điều trị rối loạn tăng động giảm chú ý” do khoa Tâm thần và Trung tâm chỉ đạo tuyến Nhi khoa – Bệnh Viện Nhi Trung ương phối hợp cùng Janssen Cilag Việt Nam tổ chức ngày 26/5/2021, Tỷ lệ trẻ em mắc rối loạn tăng động giảm chú ý thay đổi tùy theo các nghiên cứu, ước tính từ 3-8%, lứa tuổi thường đi khám là 6-7 tuổi, trẻ trai có khả năng mắc cao gấp 3 lần trẻ gái.</p>
                        <p><span style="color: #67ac2f;"> &#8226; </span> Đứng trước thực trạng đó, liệu cha mẹ và gia đình đã có những biện pháp hỗ trợ con kịp thời? Nếu không được phát hiện, can thiệp và trị liệu, tương lai của con sẽ bị ảnh hưởng nghiêm trọng. Con chậm nói, khó khăn trong giao tiếp, không biết thể hiện nhu cầu của mình; con trầm cảm, con sống khép mình, luôn lo âu, có các hành vi tăng động, tự làm hại mình, thậm chí tìm tới hành vi tự tử.
