                <p><span style="color: #67ac2f;"> &#8226; </span> Cha mẹ nghi ngờ con phát triển chậm trễ hơn so với các bạn cùng độ tuổi? Con có những biểu hiện của rối loạn phát triển như tự kỷ, tăng động giảm chú ý, chậm nói,...? Con đang gặp phải vấn đề về tâm lý?. CKCare sẽ giúp cha mẹ nhanh chóng đánh giá sự phát triển của con và các vấn đề về tâm lý, từ đó có những nhận định chính xác, kịp thời về tình trạng của con, từ đó có hướng can thiệp, trị liệu phù hợp.</p>
                <p><span style="color: #67ac2f;"> &#8226; </span> CKCare được ứng dụng rộng rãi và phù hợp với các gia đình có con trong độ tuổi từ 12 tháng - 18 tuổi.</p>

                <p><span style="color: #67ac2f;"> &#8226; </span> CKCare bao gồm 4 bộ công cụ tiên tiến, có độ chính xác cao, mỗi bộ công cụ sẽ phù hợp với từng độ tuổi và vấn đề con đang gặp phải, cụ thể:</p>

                <a href="{{route('clients.ckcare.asq3')}}">
                    <p style="font-style: italic; font-weight: 500;"><span style="color: #67ac2f;"> &#8226; </span> ASQ3: Đánh giá sự phát triển của con trong độ tuổi từ 12 tháng - 66 tháng.</p>
                </a>
                <a href="{{route('clients.ckcare.adhd')}}">
                    <p style="font-style: italic; font-weight: 500;"><span style="color: #67ac2f;"> &#8226; </span> ADHD: Đánh giá tăng động giảm chú ý cho con, có 2 phiên bản: dành cho các con từ 0 - 6 tuổi và dành cho các con từ 6 tuổi - 15 tuổi.</p>
                </a>
                <a href="{{route('clients.ckcare.mchat')}}">
                    <p style="font-style: italic; font-weight: 500;"><span style="color: #67ac2f;"> &#8226; </span> M - Chat: Đánh giá các biểu hiện liên quan đến rối loạn phổ tự kỷ cho con, trong độ tuổi từ 12 tháng - 36 tháng.</p>
                </a>
                <a href="{{route('clients.ckcare.cbcl')}}">
                    <p style="font-style: italic; font-weight: 500;"><span style="color: #67ac2f;"> &#8226; </span> CBCL: Đánh giá các vấn đề liên quan đến tâm lý, sức khỏe tâm thần của các con (lo âu, trầm cảm, thu mình, chống đối xã hội,...) trong độ tuổi từ 6 - 18 tuổi .</p>
                </a>
                <p><span style="color: #67ac2f;"> &#8226; </span> Các bộ công cụ trên đã được sử dụng rộng rãi trên thế giới và được chuẩn hóa phù hợp với trẻ em Việt Nam, chính vì thế, cả 4 bộ công cụ trên đảm bảo độ tin cậy rất cao.</p>
                <p><span style="color: #67ac2f;"> &#8226; </span> Cha mẹ dựa vào độ tuổi, vấn đề con đang gặp khó khăn để lựa chọn bộ công cụ phù hợp để sàng lọc, đánh giá cho con của mình.</p>
                <p><span style="color: #67ac2f;"> &#8226; </span> Việc phát hiện sớm các vấn đề chậm trễ, khó khăn của con là tiền đề quan trọng, là cơ sở để các chuyên gia dày kinh nghiệm của Youcare có thể hỗ trợ, đưa ra phương pháp, lộ trình trị liệu-can thiệp phù hợp tối ưu cho con.</p>
